	add("plumage", "{\"term\":\"plumage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|plumage}} (14c.), itself from {{m|fro|plume||feather}} (from Latin {{m|la|pluma||feather, down}}, from a Proto-indo-european base {{m|ine-pro|*plews-||to pluck, a feather, fleece}} + {{m|fro|-age}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Feathers, either covering a bird or used ornamentall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, w:Monty Monty Python, \u0026quot;w:Monty Python’s Flying Monty Python’s Flying Circus\u0026quot; (\u0027w:Dead Parrot Dead Parrot sketch\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Owner]: \u0027No no he\u0027s not dead, he\u0027s, he\u0027s restin\u0027! Remarkable bird, the Norwegian Blue, idn\u0027it, ay? Beautiful \u0027\u0027plumage\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Mr. Praline]: \u0027The \u0027\u0027plumage\u0027\u0027 don\u0027t enter into it. It\u0027s stone dead\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Finery or elaborate dress\", \"priority\":5}]}, \"synonyms\":{}}");

	add("plumbate", "{\"term\":\"plumbate\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|plumb|ate|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any compound containing the plumbate ion PbO\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;\u0026lt;sup\u0026gt;2\u0026amp;minus;\u0026lt;/sup\u0026gt; or Pb(OH)\u0026lt;sub\u0026gt;6\u0026lt;/sub\u0026gt;\u0026lt;sup\u0026gt;2\u0026amp;minus;\u0026lt;/sup\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

