	add("plummet", "{\"term\":\"plummet\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old english (ca. 450-1100) \u0027plommet\u0027 (lang\u003dang) recorded since 1382, from Old french (842-ca. 1400) \u0027plommet\u0027 or \u0027plomet\u0027 the diminutive of \u0027plom\u0027 \u0027plum\u0027 (lang\u003dfro) from Latin \u0027plumbum\u0027 (lang\u003dla) The verb is first recorded in 1626, originally meaning \u0026quot;to fathom, take soundings\u0026quot;, from the noun.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of lead attached to a line, used in sounding the depth of water\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1610\u0027\u0027, \u0027s:The The Tempest\u0027, by w:William Shakespeare, act 3 scene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I\u0027ll sink him deeper than e\u0027er \u0027\u0027plummet\u0027\u0027 sounded\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A plumb bob or a plumb line\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hence, any weight\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1945,\u0027\u0027 w:Ernie Ernie Pyle, \u0027Here is Your War: Story of G.I. Joe\u0027, The World Publishing Company (1945), page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"His parachute was shot half away, and if he\u0027d jumped he would have fallen like a \u0027\u0027plummet\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A piece of lead formerly used by school children to rule paper for writin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"a plummet line, a line with a plummet; a sounding line\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Violent or dramatic fal\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"decline; fall; dro\", \"priority\":11}]}, \"synonyms\":{}}");

