	add("plunder", "{\"term\":\"plunder\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"West Frisian\", \"hutterite german\", \"Dutch\", \"saterfriesisch\"], \"text\":\"Recorded since 1632 (during the Thirty Years War, native British use since the Cromwellian Civil War), from Hutterite german \u0027plunderen\u0027 (to plunder, originally \u0026quot;to take away household furniture\u0026quot;) (Dutch \u0027plunderen\u0027 from \u0027plunder\u0027 (household goods, clothes; lumber, baggage) akin to Middle dutch (ca. 1050-1350) {{m|dum|plunder||household goods}}, Saterfriesisch {{m|stq|plunnerje||to loot, plunder}}, West frisian \u0027plunje\u0027 () and Dutch \u0027plunje\u0027 (clothes)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An instance of plunderin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The loot attained by plunderin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Hessian kept his choicest \u0027\u0027plunder\u0027\u0027 in a sack that never left his person, for fear that his comrades would steal it\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"baggage; luggage\", \"priority\":4}]}, \"synonyms\":{}}");

	add("plunge", "{\"term\":\"plunge\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027plungen\u0027 \u0027ploungen\u0027 Anglo-norman \u0027plungier\u0027 from Old french (842-ca. 1400) \u0027plonger\u0027 (Modern French \u0027plonger\u0027 , from unattested frequentative *\u0027\u0027 (plumbicare) from Latin \u0027plumbum\u0027 (lead) Compare \u0027plumb\u0027 \u0027plounce\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of plunging or submergin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a dive, leap, rush, or pitch into (into water\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to take the water with a plunge\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"plunge in the sea\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the act of pitching or throwing one\u0027s self headlong or violently forward, like an unruly hors\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"heavy and reckless betting in horse racing; hazardous speculatio\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"an immersion in difficulty, embarrassment, or distress; the condition of being surrounded or overwhelmed; a strait; difficulty\", \"priority\":7}]}, \"synonyms\":{}}");

