	add("pluralism", "{\"term\":\"pluralism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|plural|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being plural, or in the plural number\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of a pluralist; the holding of more than one ecclesiastical living at a time\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A social system based on mutual respect for each other\u0027s cultures among various groups that make up a society, wherein subordinate \u0026lt;!--isthathe wordwewant?--\u0026gt;groups do not have to forsake their lifestyle and traditions but, rather, can express their culture and participate in the larger society free of prejudice.\u0026lt;!--seems like a feel-good def for middle schoolers--\u0026gt\", \"priority\":3}]}, \"synonyms\":{}}");

	add("plurality", "{\"term\":\"plurality\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) \u0027pluralité\u0027 (lang\u003dfro) from Latin \u0027plūrālitās\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being plural\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The holding of multiple benefices\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1644\u0027\u0027, \u0027Aeropagitica\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It was the complaint and lamentation of Prelats, upon every least breath of a motion to remove \u0027\u0027pluralities\u0027\u0027, and distribute more equally Church revennu\u0027s, that then all learning would be for ever dasht and discourag\u0027d\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A state of being numerous\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A number or part of a whole which is greater than any other number or part, but not necessarily a majority\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A number of votes for a single candidate or position which is greater than the number of votes gained by any other single candidate or position voted for, but which is less than a majority of valid votes cast\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027 September 8, \u0026quot;Crime against clarity\u0026quot;, editorial, w:Bangor Daily \u0027Bangor Daily News\u0027, page 14\u0026amp;nbsp;[http://news.google.com/newspapers?id\u003d818zAAAAIBAJ\u0026amp;sjid\u003dTiMIAAAAIBAJ\u0026amp;pg\u003d1343,2352985\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"To repeal the tax (Question I), a 50 per cent majority vote is required. To keep the tax in its 1976 form (Question III), only a \u0027\u0027plurality\u0027\u0027 of votes is required\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A margin by which a number exceeds another number, especially of votes\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1948\u0027\u0027 December 10, \u0026quot;President Race Ignored by 683,382 Voters\u0026quot;, w:The Deseret \u0027The Deseret News\u0027, page A-2\u0026amp;nbsp;[http://news.google.com/newspapers?id\u003dacQcAAAAIBAJ\u0026amp;sjid\u003dulcEAAAAIBAJ\u0026amp;pg\u003d6598,2141245\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Truman\u0027s total vote was 24,104,836. Dewey received 21,969,500;. Truman won by a \u0027\u0027plurality\u0027\u0027 of 2,135,336, but it was the first time since 1916 that a winner has failed to capture a majority of all votes cast\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A group of many entities: a large number\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027plurality\u0027\u0027 of ideas were put forth at the meeting, most of which were rejected out of hand\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A group composed of more than one entity\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, United States Patent 5065364, abstract\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"The array is organized into a \u0027\u0027plurality\u0027\u0027 of vertical (column) blocks\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"polygamy\", \"priority\":18}]}, \"synonyms\":{}}");

	add("pluralization", "{\"term\":\"pluralization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of making plural\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In English \u0027\u0027pluralization\u0027\u0027 usually involves adding an \u0027S\u0027, but not always\", \"priority\":2}]}, \"synonyms\":{}}");

